import React, { Component } from "react";
import "./index.css";
import ClipView from "./clip-cell";
export default class ClipsBar extends Component {
  constructor(props) {
    this.state = {
      data: [],
    };
  }
  render() {
    const { data } = this.state;
    return <div>
        {data.map((clip)=> {
            <ClipView/>
        })}
        </div>;
  }
}
